// Redux
import {createStore} from 'redux';

// Initial state
const initialState = {};

// Reducer
const reducer = (state, action) => {
  return state;
}

// Store (redux)
export const store = createStore(reducer, initialState,
  window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__());
